geregisseerd door Norma Bailey
met Madeleine Stowe, James Remar en Ian Ziering

Patty Addison is een sociale werkster die, na het meemaken van een tragedie, zich stort op het helpen van kinderen in nood. Ze neemt Emily in huis, een 9-jarig meisje dat zojuist haar moeder heeft verloren in een auto-ongeluk. Met behulp van haar goedhartigheid herinnert Patty zich weer de ware betekenis van Kerstmis.

